import React from "react";
import ReactDOM from "react-dom";
import "./index.css"
import Card from "./Card";
import Sdata from "./Sdata";

ReactDOM.render(
  <>
  <h1 className="text-center m-3">Official Netflix Movies</h1>,

 {Sdata.map((val,index) =>{
   return(
     <Card
       imgsrc={val.imgsrc}
        title={val.title}
        sname={val.sname}
        Link={val.Link}
     />
   )
 })}


  </>,
  document.getElementById("root")
)
